import React from "react";
// import s from "./RecipesPage.module.css";
import { RecipesDetails, RecipesList } from "../recipes-page-components";
import { Row } from "../ui";
import { withRouter } from "react-router-dom";

const RecipesPage = ({ history, match }) => {
  let { id } = match.params;
  id = parseInt(id);
  return (
    <RecipesList
      onItemSelected={(id) => {
        history.push(`${id}`);
      }}
    />
